import React, { useState } from 'react';
import "./App.css";
import Data from "./data.json";
import Chronology from "./components/Chronology"

const Image = (props) => {
  //will have to change css so position is defined by React
  return (
    <img src={`/library/logo192.png`}/>
  )
}



function App() {

  //user defined
  const radius = 5;
  const fontSize = 20;

  //data is initially set to imported json array Data
  const src = Data.line1;

  return (
    <>
      <Chronology src={src} radius={radius} fontSize={fontSize}/>
      <div className="images">
        {Chronology.data ? <Image urls={Data.imgs}/> : null}
      </div>
    </>
  );

}

export default App;
